 {};\n               dataset.type = \"pieChart\";\n               dataset.description = \"Process instance overview (\" + new java.util.Date() + \")\";\n               dataset.data = {};\n            \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var version = result.getLong(2)\n                 var count = result.getLong(3);\n                 dataset.data[name + \" (v\" + version + \")\"] = count;\n               }\n               reportData.datasets.push(dataset);\n\n               var dataset2 = {};\n               dataset2.type=\"list\";\n               dataset2.description = \"List overview of process instances\";\n               dataset2.data = dataset.data;\n               reportData.datasets.push(dataset2);\n               \n               execution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n               */\n               \n               /* JDK 6+ */\n               var reportData = new ReportData;\n               var dataset = reportData.newDataset();\n               dataset.type = \"pieChart\";\n               dataset.description = \"Process instance overview (\" + new java.util.Date() + \")\";\n               \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var version = result.getLong(2);\n                 var count = result.getLong(3);\n                 dataset.add(name + \" (v\" + version + \")\", count);\n               }\n               \n               var dataset2 = reportData.newDataset();\n               dataset2.type=\"list\";\n               dataset2.description = \"List overview of process instances\";\n               dataset2.data = dataset.data;\n               \n               execution.setVariable(\"reportData\", reportData.toBytes());\n               \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\" targetRef=\"theEnd\" />\n        \n        <endEvent id=\"theEnd\" />\n        \n    </process>\n\n</definitions>',0),('43',1,'org/activiti/explorer/demo/process/reports/helpdeskFirstLineVsEscalated.bpmn20.xml','41','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" \n    targetNamespace=\"activiti-report\">\n\n    <process id=\"helpdesk-firstline-vs-escalated-report\" name=\"Helpdesk process: firstline vs escalated\" isExecutable=\"true\">\n    \n        <startEvent id=\"startevent1\" name=\"Start\" />\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\" targetRef=\"generateDataset\" />\n        \n        <scriptTask id=\"generateDataset\" name=\"Execute script\" scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n          <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(org.activiti.explorer.reporting);\n               \n               var escalatedResult = ReportingUtil.executeSelectSqlQuery(\"SELECT count(*) FROM ACT_HI_ACTINST where END_TIME_ is not null and ACT_ID_ = \'handleEscalation\' and PROC_DEF_ID_ like \'escalationExample%\'\");\n               escalatedResult.next();\n               var escalatedCount = escalatedResult.getLong(1);\n               \n               var firstLineResult = ReportingUtil.executeSelectSqlQuery(\"SELECT count(*) FROM ACT_HI_PROCINST where END_TIME_ is not null and PROC_DEF_ID_ like \'escalationExample%\'\");\n               firstLineResult.next();\n               var firstLineCount = firstLineResult.getLong(1) - escalatedCount;\n               \n               /* JDK 7 only \n               var reportData = {};\n               \n               var dataset = {};\n               dataset.description = \"Helpdesk process: issues solved in first line vs escalation needed\";\n               dataset.type = \"pieChart\";\n               reportData.datasets = [];\n               \n               \n               if (escalatedCount > 0 || firstLineCount > 0) {\n                   dataset.data = {\"First line solved\" : firstLineCount, \"Escalation needed\" : escalatedCount};\n               } \n\n               reportData.datasets.push(dataset);\n               \n               execution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n               */\n               \n               /* JDK 6+ */\n               \n               var reportData = new ReportData();\n               var dataset = reportData.newDataset();\n               dataset.description = \"Helpdesk process: issues solved in first line vs escalation needed\";\n               dataset.type = \"pieChart\";\n               \n               if (escalatedCount > 0 || firstLineCount > 0) {\n                 dataset.add(\"First line solved\", firstLineCount);\n                 dataset.add(\"Escalation needed\", escalatedCount);\n               } \n               \n               execution.setVariable(\"reportData\", reportData.toBytes());\n               \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\" targetRef=\"theEnd\" />\n        \n        <endEvent id=\"theEnd\" />\n        \n    </process>\n\n</definitions>',0),('44',1,'org/activiti/explorer/demo/process/reports/employeeProductivity.bpmn20.xml','41','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"activiti-report\">\n\n    <process id=\"employee-productivity-report\" name=\"Employee productivity\"\n        isExecutable=\"true\">\n\n        <startEvent id=\"startevent1\" name=\"Start\">\n            <extensionElements>\n                <activiti:formProperty id=\"employee\" name=\"Employee\"\n                    type=\"user\" required=\"true\" />\n                <activiti:formProperty id=\"month\" name=\"Month\"\n                    type=\"month\" required=\"true\" />\n            </extensionElements>\n        </startEvent>\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\"\n            targetRef=\"generateDataset\" />\n\n        <scriptTask id=\"generateDataset\" name=\"Execute script\"\n            scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n            <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(java.util);\n               importPackage(org.activiti.explorer.reporting);\n               \n              var reportData = {\n\"title\": \"My Report\",\n\"datasets\": [\n{\n\"type\" : \"lineChart\",\n\"description\" : \"My first chart\",\n\"xaxis\" : \"Category\",\n\"yaxis\" : \"Total sales\",\n\"data\" :\n{ \"2010\" : 50, \"2011\" : 33, \"2012\" : 17, \"2013\" : 87 }\n}\n]\n}; \nexecution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n           \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\"\n            targetRef=\"theEnd\" />\n\n        <endEvent id=\"theEnd\" />\n\n    </process>\n\n</definitions>',0),('45',1,'org/activiti/explorer/demo/process/reports/taskDurationForProcessDefinition.bpmn20.xml','41','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" \n    targetNamespace=\"activiti-report\">\n\n    <process id=\"task-duration-report\" name=\"Task duration report\" isExecutable=\"true\">\n    \n        <startEvent id=\"startevent1\" name=\"Start\">\n          <extensionElements>\n            <activiti:formProperty id=\"processDefinition\" name=\"Select process definition\" type=\"processDefinition\" required=\"true\" />\n            <activiti:formProperty id=\"chartType\" name=\"Chart type\" type=\"enum\" required=\"true\">\n                <activiti:value id=\"pieChart\" name=\"Pie chart\" />\n                <activiti:value id=\"barChart\" name=\"Bar chart\" />\n            </activiti:formProperty>\n          </extensionElements>\n        </startEvent>\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\" targetRef=\"generateDataset\" />\n        \n        <scriptTask id=\"generateDataset\" name=\"Execute script\" scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n          <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(org.activiti.explorer.reporting);\n               \n               var processDefinition = execution.getVariable(\"processDefinition\");\n               \n               var result = ReportingUtil.executeSelectSqlQuery(\"select NAME_, avg(DURATION_) from ACT_HI_TASKINST where PROC_DEF_ID_ = \'\" + processDefinition.getId() + \"\' and END_TIME_ is not null group by NAME_\");\n            \n               /* JDK 7\n               \n               var reportData = {};\n               reportData.datasets = [];\n               \n               var dataset = {};\n               dataset.type = String(execution.getVariable(\"chartType\"));\n               dataset.description = \"Average task duration (in seconds) for process definition \'\" + processDefinition.getName() + \"\' (version \" + processDefinition.getVersion() + \")\";\n               dataset.data = {};\n               \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var val = result.getLong(2) / 1000;\n                 dataset.data[name] = val;\n               }\n               reportData.datasets.push(dataset);\n               \n               execution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n               \n               */\n               \n               /* JDK 6+ */\n               \n               var reportData = new ReportData();\n               var dataset = reportData.newDataset();\n               dataset.type = execution.getVariable(\"chartType\");\n               dataset.description = \"Average task duration (in seconds) for process definition \'\" + processDefinition.getName() + \"\' (version \" + processDefinition.getVersion() + \")\";\n               \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var val = result.getLong(2) / 1000;\n                 dataset.add(name, val);\n               }\n               \n                execution.setVariable(\"reportData\", reportData.toBytes());\n               \n          ]]></script>\