  `PId` bigint(20) NOT NULL COMMENT '外键ID,关联bi_db_dict主表',
  `Code` varchar(230) DEFAULT NULL COMMENT '编码值',
  `Name` varchar(200) DEFAULT NULL COMMENT '名称',
