/*Table structure for table `bi_leave` */

DROP TABLE IF EXISTS `bi_leave`;

CREATE TABLE `bi_leave` (
  `Id` bigint(20) NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) DEFAULT NULL COMMENT '请假条名称(标题)',
  `Content` varchar(200) DEFAULT NULL COMMENT '内容说明',
  `Description` varchar(100) DEFAULT NULL COMMENT '请假原由',
  `ApplyUserId` bigint(20) DEFAULT NULL COMMENT '申请人id',
  `ApplyUserName` varchar(20) DEFAULT NULL COMMENT '申请人用户名',
  `ReceiveUserId` bigint(20) DEFAULT NULL COMMENT '受理人id',
  `ReceiveUserName` varchar(20) DEFAULT NULL COMMENT '受理人用户名',
  `CreationTime` timestamp NULL DEFAULT NULL COMMENT '申请日期',
  `Status` int(5) DEFAULT NULL COMMENT '审批状态：0已提交(草稿)，1审批中(已提交)，2通过，3不通过',
  `ApproveTime` timestamp NULL DEFAULT NULL COMMENT '审批完成日期',
  `TaskId` varchar(100) DEFAULT NULL COMMENT '工作流id',
  `ProcessInstanceId` varchar(100) DEFAULT NULL COMMENT '工作流实例Id',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

